import React from 'react';
import {HashRouter,Routes, Switch} from "react-router-dom";
import App from "./App";
import Search from "./Search"

const Router=()=>{
    return( 
        <HashRouter>
            <Switch>
                <Routes exact path="/" component={App}/>
                <Routes path="/search" component={Search}/>
            </Switch>
        </HashRouter>
    );
}

export default Router;
